    html {
     height: 100%;
    }
    body {
     position: absolute;
     left: 0;
     right: 0;
     bottom: 0;
     top: 0;
     margin: 0;
     padding: 0;
    }
    #tabBootErr {
     display: none;
     position: absolute;
     top: 100px;
     width: 300px;
     left: 50%;
     margin-left: -150px;
     border: 1px solid black;
     background: white;
     padding: 0;
     box-shadow: 0px 5px 10px #adadad;
     font-family: Arial, Helvetica, sans-serif;
     z-index:999;
    }
    #tabBootErrTitle {
     font-size: 11pt;
     font-weight: bold;
     color: #1F437D;
     background-color: #EBEEF3;
     padding: 5px 6px 3px 6px;
    }
    #tabBootErrBody{
     overflow: auto;
     color: #333333;
     font-size: 10pt;
     font-weight: normal;
     background: white;
     border: none;
     border-top: 1px solid black;
     padding: 10px;
     -moz-user-select: text;
     -webkit-user-select: text;
     -ms-user-select: text;
     user-select: text;
    }
    #tabBootErrMsg {
     white-space: pre-line;
    }
    #main-content:focus {
     border: 1px solid #3498DB;
    }






